Na China do século 19 e início do século 20, a execução era considerada uma punição preferida à prisão, porque estar em confinamento acabou sendo uma morte lenta. Estar na prisão era pago por parentes, e eles próprios frequentemente pediam que o perpetrador fosse morto. Eles não mantinham os condenados nas prisões - era muito caro. Se os parentes tivessem dinheiro, eles poderiam levar seu ente querido para manutenção (geralmente ele se sentava em um poço de terra). Mas apenas uma pequena parte da sociedade era capaz de pagar. Portanto, o principal método de punição para crimes menores (roubo, insulto a um funcionário etc.) eram ações. O tipo mais comum de forma é "kanga" (ou "jia"). 
Foi muito utilizado, pois não exigia que o estado construísse uma prisão e também impedia a fuga.

